import React from 'react';

const person = (Props) => {
    return (
        <div>
            <h2>Hey this is parent component</h2>
            <p>this parent is great. My name is {Props.name} and I am { Math.floor(Math.random() * 30) } yrs old</p>
            <p>{this.Pro}</p>
        </div>
    );
}

export default person;
